class Merchant {  Merchant({      this.id,       this.createdAt,       this.phones,       this.companyEmails,       this.companyName,       this.state,       this.country,       this.city,       this.postalCode,       this.street,});  Merchant.fromJson(dynamic json) {    id = json['id'];    createdAt = json['created_at'];    phones = json['phones'] != null ? json['phones'].cast<String>() : [];    companyEmails = json['company_emails'] != null ? json['company_emails'].cast<String>() : [];    companyName = json['company_name'];    state = json['state'];    country = json['country'];    city = json['city'];    postalCode = json['postal_code'];    street = json['street'];  }  int ?id;  String ?createdAt;  List<String>? phones;  List<String>? companyEmails;  String ?companyName;  String? state;  String? country;  String? city;  String? postalCode;  String? street;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['created_at'] = createdAt;    map['phones'] = phones;    map['company_emails'] = companyEmails;    map['company_name'] = companyName;    map['state'] = state;    map['country'] = country;    map['city'] = city;    map['postal_code'] = postalCode;    map['street'] = street;    return map;  }}